import { useState } from "react";
import React from "react";

function Profiles({users}) {

const [user, setUser] = useState()

const uniqUsers = users.filter(
  (user, index, self)=> index === self.findIndex(u=> u.userId === user.userId)
)

const handleClick= (e)=>{
  setUser(e.target.userId)
}

  return (
    <div className="profiles">
      <h1>Select a ptofile</h1>
      <ul>
      {uniqUsers.map(user => {
        return(
        <li onClick={handleClick} key={user.id}>{user.userId}</li> 
        );
      })}
      </ul>
    </div>
  );
}

export default Profiles;
